Information
------------------------------

Girls Can Code
Radio 1's Alice Levine takes five girls who can take selfies and finds out if they can take on and take over the male-dominated digital world.
Half of all gamers are women - but only 4 per cent code them. Only seven of the richest 100 tech billionaires are women.
Alice Levine is outraged! So she's pushing East End Ellie, ditzy art student Daisy, science boffin Neelam, fashion grad Tolani and wannabe millionaire Arooj into the testosterone-fuelled worth of tech.


1)  1 
In episode one, to prove the world of tech isn't just pizza-munching teenage boys and male masters of the machine universe, our girls take a whirl around London's silicon roundabout in the company of the most powerful women in tech. Fashion, gaming, apps - and digital slap! - the girls learn that making millions in the digital world isn't just about learning ones and zeroes, it's following your passion. And the cash will follow. But are they up to the challenge of inventing a start-up from scratch in just five days? It's an emotional ride... and it's not just the code that'll crack.

2)  Part 2 
In episode two, the girls must take their cutting-edge coding brainwave and learn how to turn it into a prototype product and a perfect pitch to the great and good of the UK tech world. If they can convince the cream of the coding world that they've gone from zeroes to heroes in just a week, their lives might just change forever. But along the way, the girls find out that it's not just about a cool idea: the gloves are off as they learn to code, get down and dirty with big data and - toughest of all - overcome their own fears and failures to stand a chance when they pitch their digital product. Who'll come out on top, and who'll blow a fuse? And as the girls laugh, cry, scream with joy and frustration along the way, they don't know that this is not a rehearsal, and that their lives could be about to change. For real.

